import { InputNumber, InputText } from "primereact";
import { ButtonPrimary } from "../../../shared/components/buttons/ButtonPrimary";

import "./styles.css";
export const FormsPersons = ({ data }: any) => {
  return (
    <div className="container-fluid">
      <div className="display-flex">
        <h1>Register Person</h1>
        <form
          action=""
          onSubmit={() => {
            data.handleSubmit;
          }}
        >
          <div className="form-group">
            <label htmlFor="input">Full Name</label>
            <InputText id="input" value={data?.id || ""} />
          </div>
          <div className="form-group">
            <label htmlFor="number">Identity</label>
            <InputNumber id="number" value={data?.price || ""} />
          </div>
          <ButtonPrimary
            label="Guardar"
            type={"submit"}
            key="form-person"
            iconsPos="left"
            styles={{ width: "100%" }}
          />
        </form>
      </div>
    </div>
  );
};
